import React from 'react'

const LandingInstance = (props) => {
    return (
        <div>
            <div className="container">
                <h1 className="landing-caption">{props.landingCaption}</h1>
            </div>
            <div className="landing-bg" style={{background: `./img/Nile-bridge-cc-new.jpg`}, height}></div>
        </div>
    )
}

export default LandingInstance
